CREATE TABLE "store_orderitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "price" decimal NOT NULL, "order_id" bigint NOT NULL REFERENCES "store_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "store_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "store_payment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "payment_method" varchar(20) NOT NULL, "payment_status" varchar(20) NOT NULL, "amount" decimal NOT NULL, "transaction_id" varchar(100) NOT NULL, "payment_date" datetime NOT NULL, "order_id" bigint NOT NULL UNIQUE REFERENCES "store_order" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "store_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "description" text NOT NULL, "price" decimal NOT NULL, "stock_quantity" integer NOT NULL, "image_url" varchar(200) NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "category_id" bigint NOT NULL REFERENCES "store_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "store_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" integer NOT NULL, "comment" text NOT NULL, "created_at" datetime NOT NULL, "customer_id" bigint NOT NULL REFERENCES "store_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "store_product" ("id") DEFERRABLE INITIALLY DEFERRED);
